import { useState } from "react";



function App() {
  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <header className="App-header">
        <h1>"helllllllllllllllllllo"</h1>
        <button onClick={() => setCount(count++)}>"click me"</button>
        <p>You clicked {count} times</p>

      </header>
    </div>);
}

export default App;
